"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F16124888\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Ravicti&trade;: FDA approved February 2013; anticipated availability is April 30, 2013. Consult prescribing information for additional information.",
"    </p>",
"   </div>",
"   <div class=\"block meg drugH1Div\" id=\"F16132309\" xmlns=\"file://www.w3.org/1999/xhtml\">",
