"     <a href=\"file://www.fda.gov/downloads/Drugs/DrugSafety/UCM338056.pdf\" target=\"_blank\">",
"      file://www.fda.gov/downloads/Drugs/DrugSafety/UCM338056.pdf",
"     </a>",
"     , must be dispensed with this medication.",
"    </p>",
"   </div>",
