" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 506px\">",
"   <div class=\"ttl\">",
"    Duodenal transection during total gastrectomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 486px; height: 715px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
