"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?2/8/2186/abstract/1\">",
"      Moloney FJ, Comber H, O'Lorcain P, et al. A population-based study of skin cancer incidence and prevalence in renal transplant recipients. Br J Dermatol 2006; 154:498.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?2/8/2186/abstract/2\">",
"      Moosa MR. Racial and ethnic variations in incidence and pattern of malignancies after kidney transplantation. Medicine (Baltimore) 2005; 84:12.",
"     </a>",
"    </li>",
