"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Licensed vaccines containing inactivated poliovirus vaccine (IPV) - United States",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Vaccine composition",
"      </td>",
"      <td class=\"subtitle1\">",
"       Trade name",
"      </td>",
"      <td class=\"subtitle1\">",
"       Manufacturer",
"      </td>",
"      <td class=\"subtitle1\">",
"       Approved use in ACIP routine schedule*",
"      </td>",
"      <td class=\"subtitle1\">",
"       Comments",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       IPV",
"      </td>",
"      <td>",
"       Ipol (Poliovax&Delta;)",
"      </td>",
"      <td>",
"       Sanofi Pasteur",
"      </td>",
"      <td>",
"       2, 4, 6-18 mos, and 4-6 yrs&bull;",
"      </td>",
"      <td>",
"       Approved for use in infants, children, and adults&loz;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       DTaP-HepB-IPV&sect;",
"      </td>",
"      <td>",
"       Pediarix",
"      </td>",
"      <td>",
"       GlaxoSmithKline",
"      </td>",
"      <td>",
"       2, 4, and 6 mos",
"      </td>",
"      <td>",
"       Approved for first 3 doses of IPV through age 6 yrs&yen;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       DTaP-IPV/Hib&Dagger;",
"      </td>",
"      <td>",
"       Pentacel",
"      </td>",
"      <td>",
"       Sanofi Pasteur",
"      </td>",
"      <td>",
"       2, 4, 6, and 15-18 mos&dagger;",
"      </td>",
"      <td>",
"       Approved for 4 doses of IPV through age 4 yrs**",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       DTaP-IPV&bull;&bull;",
"      </td>",
"      <td>",
"       Kinrix",
"      </td>",
"      <td>",
"       GlaxoSmithKline",
"      </td>",
"      <td>",
"       4-6 yrs",
"      </td>",
"      <td>",
"       Approved for booster dose at age 4-6 yrs&Delta;&Delta;",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Advisory Committee on Immunization Practices. Full schedule available at file://www.cdc.gov/mmwr/preview/mmwrhtml/mm5751a5.htm.",
"     <br>",
"      &bull; In the IPV series the minimum age for dose 1 is 6 weeks. The minimum interval is 4 weeks between dose 1 and 2, and between dose 2 and 3. The minimum interval between dose 3 and 4 is 6 months. Dose 4 should be administered at age &ge;4 years regardless of the number of previous doses. Shorter intervals and earlier start dates lead to lower seroconversion rates; therefore, the minimum age and minimum intervals in the first 6 months of life are recommended only if the recipient is at risk for imminent exposure to circulating poliovirus (eg, during an outbreak or because of travel to an endemic region).",
"      <br>",
"       &Delta; Not currently distributed in the United States.",
"       <br>",
"        &loz; Package insert available at file://www.fda.gov/downloads/biologicsbloodvaccines/vaccines/approvedproducts/ucm133479.pdf.",
"        <br>",
"         &sect; Diphtheria and tetanus toxoids and acellular pertussis adsorbed, hepatitis B (recombinant), and inactivated poliovirus vaccine combined.",
"         <br>",
"          &yen; Package insert available at file://www.fda.gov/downloads/biologicsbloodvaccines/vaccines/approvedproducts/ucm168055.pdf.",
"          <br>",
"           &Dagger; Diphtheria and tetanus toxoids and acellular pertussis adsorbed, inactivated poliovirus, and",
"           <em>",
"            Haemophilus",
"           </em>",
"           b conjugate (tetanus toxoid conjugate) vaccine.",
"           <br>",
"            &dagger; When Pentacel is used to provide 4 doses at ages 2,4,6 and 15-18 months, and additional booster dose of age-appropriate IPV containing vaccine (Ipol or Kinrix) should be administered at age 4-6 years. This will results in a 5-dose IPV series; Pentacel is not indicated for the booster dose at age 4-6 years. The minimum interval between dose 4 and dose 5 should be at least 6 months to optimize booster response.",
"            <br>",
"             ** Package insert available at file://www.fda.gov/downloads/biologicsbloodvaccines/vaccines/approvedproducts/ucm109810.pdf.",
"             <br>",
